import React, { Component } from 'react'

 class Event extends Component {
    render() {
        return (
            <div>
                <h4>Event1</h4>
                <ul>
                    <li>Description: abc</li>
                    <li>Location: loc1</li>
                </ul>
            </div>
        )
    }
}

export default Event;
